import styled from "styled-components";

export const GraphicTag = styled.div`
  background: cyan;
  height: 25%;
  width: 100%;
`;

export const TitleTag = styled.text`
  font-size: 20px;
  color: black;
  span{
    font-weight: bold;
  }
`;
